    data: |
      SELECT DISTINCT col0 - 43 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE + 7 - + ( 43 ) * + + col1 NOT IN ( ( col0 ) + + 27 );
  - name: tab1

outputs:
  - name: q12446.out
    data: |
      42
      48
      8
